# Exemple d'utilisation
génome = Génome()
print(génome.traits_physiques)  # Affiche: {'yeux': {'vert', 'bleu', 'marron'}, 'peau': {'claire', 'foncée', 'brune'}, 'cheveux': {'noirs', 'blonds', 'bruns'}}
génome.modifier_ensemble(génome.traits_physiques['yeux'], 'yeux', 'vert')  # Modifie l'ensemble de traits yeux
