```python
class Queue:
    def __init__(self):
        self.queue = []

    # Ajoute un élément au début de la queue
    def enqueue(self, item):
        self.queue.insert(0, item)

    # Retire et retourne l'élément le plus récent de la queue
    def dequeue(self):
        if len(self.queue) < 1:
            return None
        return self.queue.pop()

    # Renvoie True si la file est vide, False sinon
    def is_empty(self):
        return len(self.queue) == 0

    # Retourne le nombre d'éléments dans la file
    def size(self):
        return len(self.queue)

